import React from 'react'
import facebookIcon from '../../public/images/ico-facebook.png';

const Footer = () => {
  return (
    <footer>
        <p>Powered by</p>
        <img src="../../public/images/DH.png" alt='DH-logo1' />
        <img src={facebookIcon} alt='facebook' />
    </footer>
  )
}

export default Footer
